  false,\n\t\"url\": null,\n\t\"notes\": \"This report outlines marsh bird monitoring
  activities in 1995 were expanded beyond black tern research to include an evaluation
  of monitoring techniques for other marsh birds such as rails and bitterns. Field
  work was therefore divided into two phases: black tern population  monitoring, and
  other marsh bird censusing. In addition, a review of recent research activities
  throughout the country was undertaken to determine research and management needs
  for the black tern in Vermont.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
